  return (
    <div>
      <Tweet
        tweetId='1491255003268644866'
        options={{
          height: '400'
        }}
      />
      <Timeline
        dataSource={{
          sourceType: 'profile',
          screenName: 'TwitterDev'
        }}
        options={{
          height: '400'
        }}
      />
    </div>
  )
}

export default EmbeddedTweet
